(458,	1405,	1,	'Hotel Test2 Gulberg',	'Situated within 29 km of Wagah Border and 500 m of Pace Shopping Mall, Hotel Tulip Inn, Gulberg features rooms with air conditioning and a private bathroom in Lahore. This 3-star hotel offers a 24-hour front desk, room service, security and free WiFi. The hotel has family rooms. The rooms in the hotel are fitted with a flat-screen TV and free toiletries. Hotel has a large dinning hall for Buffet Meals. Hotel Tulip Inn, Gulberg offers a continental or halal Buffet breakfast. Vogue Towers is 1.7 km from the accommodation, Liberty Market is 2 km, while Lahore Gymkhana is 3 km from the property. The nearest airport is Allama Iqbal International Airport, 5 km from Hotel Tulip Inn, Gulberg. We speak your language!',	'Test Service Provider',	'923373164408',	'923373164408',	NULL,	0,	1,	3,	NULL,	557,	'12:00 AM',	'2:00 PM',	'1',	'1',	NULL,	'WhatsApp-Image-2021-04-27-at-2.46.10-PM-hotelMainImg-1660863765.jpeg',	NULL,	'roadnstays.com will make payment after 07-Days of every guest check-out & roadnstays.com will be charged 15% on every guest reservation.',	1,	NULL,	1,	'20',	'80',	0,	3,	NULL,	'sdfsdf',	24,	72,	30,	10,	0,	'Gulberg III, Lahore, Pakistan',	'31.5101892',	'74.3440842',	'Lahore',	'Gulberg III',	'162',	NULL,	NULL,	NULL,	NULL,	1975,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'12',	1,	100,	'0',	0,	1,	1,	1,	0,	NULL,	'null',	'Test Service Provider',	'Test Service Provider',	2147483647,	'testserviceprovider@roadnstays.com',	2147483647,	1,	'2022-08-18 23:02:45',	'2022-11-22 12:48:00'),
