(524,	1405,	3,	'Hotel Test1 Faisal Town-approval - partial',	'Set in Lahore, 34 km from Wagah Border, Hotel Tulip Inn, Faisal Town offers accommodation with a restaurant, free private parking and a shared lounge. This 3-star hotel offers room service and a concierge service. The accommodation provides a 24-hour front desk, airport transfers, a shared kitchen and free WiFi throughout the property. The units at the hotel come with a seating area. At Hotel Tulip Inn, Faisal Town every room includes a wardrobe, a flat-screen TV and a private bathroom. Guests at the accommodation can enjoy a continental breakfast. Emporium Mall is 5 km from Hotel Tulip Inn, Faisal Town, while Gaddafi Stadium is 6 km away. The nearest airport is Allama Iqbal International Airport, 11 km from the hotel. Metro Bus station is 3 km away from hotel. Offering inclusive of Buffet Breakfast, welcome drinks, Dress Pressing, Dress washing, shoe shinning. We speak your language! Hotel Tulip Inn, Faisal Town is welcoming Venrooms.com\'s guests.',	'Test',	'923373164408',	'923373164408',	NULL,	1,	1,	5,	NULL,	1404,	'12:00 AM',	'12:00 PM',	'1',	'1',	'',	'WhatsApp Image 2022-05-16 at 12.26.38 AM (2)-hotelMainImg-1668852257.jpeg',	'',	'Venroom.com will charge 15% on guest reservations and make payment after 07-Days of guest check-out. after 6 months contract will be renewed with mutual understanding.',	2,	NULL,	2,	'20',	'80',	0,	NULL,	NULL,	'free cancellation before 48 hours',	48,	72,	20,	2,	0,	'Lahore, Pakistan',	'31.5203696',	'74.35874729999999',	'Lahore',	'Faisal Town',	'162',	NULL,	NULL,	NULL,	NULL,	4,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'12',	1,	NULL,	'0',	0,	1,	1,	1,	1,	'2',	'null',	'Test',	'Test Service Provider',	2147483647,	'testserviceprovider@roadnstays.com',	55,	1,	'2022-09-09 07:16:40',	'2022-11-19 10:46:30'),
