(721,	1387,	3,	'Hotel Graceland',	'Graceland Hotel Skardu is offering it\'s guests with clean accommodation, exquisite food and breath-taking views. Book Graceland Hotel Skardu Accommodation: The rooms are decently designed with an in-suite bathroom. They are spacious, comfortable, WiFi, carpeted and have all basic amenities\nGraceland Hotel Skardu is located on patowal road.,',	'Mansoor Raza',	'923438583177',	'923438583177',	NULL,	1,	1,	3,	NULL,	557,	'12:00 PM',	'11:30 AM',	'1',	'1',	NULL,	'IMG-20210423-WA0014-1280x790-hotelMainImg-1669236213.jpg',	NULL,	NULL,	2,	NULL,	2,	'25',	'75',	0,	NULL,	NULL,	'Free Cancellation before 48 Hours',	48,	76,	100,	0,	25,	'P. Q villa 1 Patwal road olding, skardu',	'35.289108228242995',	'75.64873604603713',	'Skardu',	NULL,	'162',	NULL,	NULL,	NULL,	NULL,	4400,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'12',	1,	NULL,	'0',	0,	1,	0,	1,	0,	NULL,	'null',	'Mansoor Raza',	'Mansoor Raza',	2147483647,	'Parvi7@gmail.com',	2147483647,	0,	'2022-11-24 02:13:33',	'2022-11-23 21:36:39'),
