(54,	1044,	'available',	'Attabad Lake',	'5 DAY PLAN\r\n2 FLIGHTS\r\n2 FLIGHTS\r\n2 ACTIVITIES',	'Attabad Lake',	'Attabad Lake, Hunza Nagar',	'36.3190424',	'74.8653331',	'Gojal',	162,	'IJ14756',	NULL,	'2022-08-01',	'2022-08-05',	'pexels-asad-photo-maldives-1320686-tourMainImg-1658817303.jpg',	'adventure',	'standard',	'5',	4555,	NULL,	NULL,	NULL,	450,	1,	'Hello',	4,	5,	477,	'vbcb',	2,	NULL,	0,	NULL,	NULL,	'fgsdg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Maldives',	'location',	'drinks',	'brekfast, lunch, dinner',	NULL,	NULL,	'Please expect to receive your vouchers 72 hours before your departure date (subject to full payment of your package cost)\r\nPlease note that these packages are customizable, which means that you will be able to make changes to the itinerary/activity if you so desire. The final payment will be calculated as per the activities reflecting on the website which will be outlined in the confirmatory e-mail sent to you.\r\nPersonal expenses such as laundry, telephone calls, room service, alcoholic beverages, mini bar etc., are not included.\r\nIn case your package needs to be cancelled due to any natural calamity, weather conditions etc.  RoadNStay shall strive to give you the maximum possible refund subject to the agreement made with our trade partners/vendors.\r\nIf payment is not made as per the schedule provided in the first booking confirmation e-mail, RoadNStay reserves the right to cancel the booking after attempting to get in touch with you. Refunds would be as per the package cancellation policy.\r\nThe passenger names in the booking form should be exactly as per passports.  RoadNStay  will not bear any liability for the name change fee, if incorrect names and ages have been added at the time of booking.',	NULL,	'Khalid',	'M.Khalid',	'123654789',	'khalid@gmail.com',	'1234567895',	'2022-07-26 06:35:03',	1,	'2022-07-26 06:35:03'),
(188,	1044,	'available',	'Shogran Valley',	'Do you wish to take a break from the mundanity and din of city life? Then embark on an amazing journey to the Northeast. Our Darjeeling tour package from Indore allows you to discover the grandeur of the Gangtok and Darjeeling at the fullest. If you are looking ahead to spend your time with your family or a honeymoon package or a trip with friends, this package would be the right option.\nHighlights\nUnwind in the exhilarating beauty of Gangtok-DarjeelingSunrise view from the Tiger hillsExcursions to Tsomgo lakeHandicraft shopping from Gangtok',	'Mansehra',	'Shogran Valley Tour, Shogran, Pakistan',	'34.6398264',	'73.4607431',	'JFQ6+W7Q, Shogran',	162,	NULL,	NULL,	'2022-11-25',	'2022-11-30',	'pexels-quang-nguyen-vinh-3355732-tourMainImg-1661259056.jpg',	'adventure',	'standard',	'6',	45,	NULL,	NULL,	NULL,	0,	0,	'not yet',	2,	10,	557,	'policy',	2,	NULL,	1,	NULL,	NULL,	'cancellation policy',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Mansehra, Shogran Valley',	'a',	'Meal Plan\nBreakfast\nAccommodation\nTwin-sharing basis at 4-star hotel\nSightseeing at Gangtok and Darjeeling\nPickup and drop by private cabs from the nearest airport and railway stations',	'Meal Plans\nLunch and Dinner\nPersonal expenses\nLaundryTelephone charges\nGratuity and Tips\nMineral water\nSoft and Hard drinks\nRiver rafting\nRock climbing\nParagliding\nAdditional sightseeing\nExtra usage of vehicles\nOther than the mentioned in the itinerary\nEntrance fees and guide charges',	NULL,	NULL,	NULL,	NULL,	'Syed Faheem',	'Syed Faheem',	'123456',	'syed@gmail.com',	'23654187',	'2022-08-23 12:50:56',	1,	'2022-08-23 12:50:56'),
