(319,	1279,	'available',	'3 Days Family Oriented Tour - Neelum Valley',	'Kashmir: Kashmir is the northern most geographical region of the Indian subcontinent. Until the mid-19th century, the term “Kashmir” denoted only the Kashmir valley between the great Himalayas and the Pir Panjal range. Today, it denoted a larger area that includes the Indian-administered territory of Jammu and Kashmir (which include the divisions Jammu, Kashmir valley and Ladakh). The Pakistani administered territories of Azad Kashmir and Gilgit Baltistan and the Chinese administered territories of Aksai chin and the Trans-Karakorum track',	'Islamabad',	'Islamabad, Pakistan',	'33.6844202',	'73.04788479999999',	'Islamabad',	162,	NULL,	NULL,	'2022-10-28',	'2022-10-30',	'WhatsApp Image 2022-10-22 at 7.07.13 PM-tourMainImg-1666456773.jpeg',	'adventure_sightseeing',	'standard',	'3',	12500,	NULL,	0,	0,	0,	0,	'For Children: 50% Discount of Age Between 5-10 (Jumper Seats)',	5,	40,	1116,	'TERMS & CONDITIONS:\n•	Using drugs or intoxication of any kind is strictly prohibited .If anyone is caught using any kind of substance on buses or during trip will be expelled from the trip on the spot. That person will not be eligible for any kind of refund.\n•	We reserve the right to cancel trip without prior notice for any reasons deemed appropriate by them.\n•	In such a case the registered participants will receive full refund.\n•	On adventure trip of this type, weather, local politics, transport or a multitude of other factors beyond the control of organizers can result in a change of itinerary.\n•	It is, however, very unlikely that the itinerary would be substantially altered; if alterations are necessary the Leader of the group and Guide will decide what the best alternative is, taking into consideration the best interests of the whole group.\n•	Smoking in the transport is strictly prohibited.\n•	Participants must hold a valid Computerized CNIC/Passport Card.\n•	Time management / punctuality is strictly recommended.\n•	Participants are advised to use Non-Slippery Shoes/Boot/Joggers/DMS. Participants must NOT wear Heel/Dress Shoes.\n•	On steep ascends in mountainous areas, air conditioned of the buses will be operational on on-off basis to keep the vehicles from overheating.\n•	The GBTC will not be responsible for any injury/damage/loss.',	2,	NULL,	2,	'1',	'99',	'7 days before the departure, 50% deduction.\n3 days before the departure, 75% deduction.\nLess than 3 days before the departure, 100% deduction.',	1,	1,	1,	1,	NULL,	NULL,	'Neelum Valley Arrangkel',	'Sightseeing – Historical Visits – Excursions',	'--Travelling Cost From LHR TO LHR\n--Travelling Cost From ISD TO ISD\n--Travel Through Private Air Conditioned Vehicle.\n(Saloon Coaster if 18-20 Persons)\n(Grand Cabin if 11-13 Persons)\n--2 night’s hotel stays as per plan on 3-4 pax sharing\n(Beds + Mattresses)\n--Quality Meals (Breakfast + Dinner) \n--Bonfire (1 Time)\n--Basic first aid kit.\n--All tolls and taxes',	'---Personal Clothing\n---Entry Tickets\n---any kind of Jeep charges or Hiace Cost in case road closed for coaster for Kalam\n---Extras at hotels like drinks, laundry, phone calls, Heaters\n---Insurance liability medical aid, and helicopter rescue coverage.\n---Anything thing other than mentioned above in “Cost Include” area is not included in cost',	NULL,	NULL,	NULL,	NULL,	'Travel with Ismail',	'Muhammad Ismail',	'2147483647',	'm.ismail.kadri123@gmail.com',	'2147483647',	'2022-10-22 22:09:33',	1,	'2022-10-22 17:09:33'),
