(337,	1279,	'available',	'Combo Tour : Snow covered Swat and Malam Jabba, Hunza Valley, Skardu, Plus Nalter Valley and Kanpur Dame',	'Travel With Smile brining Winters converting into spring season Family and couples Oriented event to Swat Valley to explore , Malam Jabba & Ski Resort, Fizza Ghat, Swat Museum, Mingora, White Palace alnogwith the Skardu and Hunza plus Nalter ak also visit  Khanpur dam on a day trip to Enjoy the Boating, Speed Boating and Parasailing.',	'Islamabad',	'Islamabad, Pakistan',	'33.6844202',	'73.04788479999999',	'Islamabad',	162,	NULL,	NULL,	'2022-11-06',	'2022-11-13',	'12 Days Combo Tour (Swat,Malam Jabba,Hunza Valley,Skardu,Nalter Valley and Khanpur Dame-tourMainImg-1667244930.jpeg',	'adventure_sightseeing',	'standard',	'8',	29999,	NULL,	0,	0,	0,	0,	'Up to 2 years stay free (no seat). +2-9 Years Kids will be charge 50% of event fee (Basic ISB Package). Kids will be allotted folding seat during trip and will accommodate with parents in Hotel Room.',	1,	40,	1283,	'Registration Deadline\nFrom Islamabad 10 days before departure date \n-Undertaking of Guest\n-	I understand that the adventure/outdoor activities carry a potential risk of personal injury. I further undertake that neither I nor my heirs or legal representatives shall raise any compensation from the Travel with smile\n\nShare with us your details for booking:\nNo. Of Persons\nParticipants names\nPayment receipt\nCNIC numbers of participants\nContact numbers of participants.\nIf any couple bring nikkah farm also',	2,	NULL,	2,	'30',	'70',	'Booking Procedure \nConfirmations will only be considered after submitting initial advance payment.For Islamabad Package 30% pp Remaining payment must deposit 07 days before departure date to Tour Operator\nCancellation Policy\n-10 Days Before Event Date:\nRs. 5000 per person deduction for Islamabad members.\n-Less then 7 Days and 2 Days before Event Date:\n50% deduction of Event Fee. \n-Less then 2 days (After or before 48 Hours of Event)\nNo refund of event fee',	48,	168,	100,	0,	NULL,	NULL,	'Islamabad\n• Swat moterway \n• Mangora\n• Malam jabba\n• shangla top\n• Thakot \n• Hazara Motorway \n• Batgram \n• Besham \n• Dasu \n• Summar Nalla \n• Chilas \n• Jaglot \n• 3 Mountain Junction Point \n• Karakorum Highway \n• Nanga Parbat View Point \n• Hunza Valley\n• Altit Fort\n• Royal Garden\n• Baltit Fort\n• Cultural Heritage of Hunza\n• Karimabad Bazar\n• Attabad Lake\n• Passu\n• Rakaposhi View Point\n• Sost\n• Hussain Bridge\n• Nalter Valley Day Trip on 4 x 4 \n• Ski & Ice Skating Site \n• Snow Leopard Cage \n• Gilgit \n• Raikot Bridge\n• Skardu\n• Shangrila Resort\n• Shigar fort\n• Mantokha waterfall\n• Kachura lake\n• Soq valley\n• Bashu Valley \n• Bashu village\n• Khanpur Dam\n• Boating, Parasailing, Jet ski',	'Big Combo Tour',	'Package Includes \n✅ 2 Meal BF and Dinner  \n✅ Transport ISB – ISB  \n✅ Fuel & Tool Taxes \n✅ Services of a Guide \n✅ Bonfire & BBQ one night \n✅ Hotel Accommodation',	'Package Not included \nPorters (for carrying personal equipment of participant) \nExtra expenses due to landslides\\road blocks \nLunch, Tea, Mineral water and Cold drinks expense \nEntry Fee of Museum | Ski Resort | Forts  \nParasailing and Boating Charges  \nExtra expenses due to the acts of nature and political reasons etc. \nAny item not mentioned above\n\nImportant Note\nOn adventure trek of this type, weather, local politics, transport or a multitude of other factors beyond the control of organizers can result in a change of itinerary. It is, however, very unlikely that the itinerary would be substantially altered; if alterations are necessary the Leader and Guide will decide what is the best alternative, taking into consideration the best interests of the whole group\nTerm and Conditions:\nOur Terms & Conditions are strictly followed and applied. We encourage you to read and agree with them carefully before booking a trip with us.\n• Minimum number to carry out a trip is 10, in case a trip is called off by Travel with smile due to low registration the members who have paid will be entitled to a 100% refund or transfer amount to the next upcoming trip. \n• We will avoid using meal provided in train or at the platforms as it is un-healthy, \n• Every member must keep his/her original CNIC.\n• Member should have to report 30 mints before departure time.\n• Only 10 Kg Cargo bags are allowed & every member is responsible for his/her own baggage, and has to carry its own luggage.\n• Member must behave ethically with his/her fellow group members; Otherwise SK Tours can cancel his/her membership at any time.\n• travel with smile is not responsible for personal injuries and accidents, (first aid will be given).\n• Travel with smile is not responsible for loss of any kind of valuable item.\n• No returns will be made in case of cancellation of booking before ONE WEEK of departure date.\n• No refunds shall be made in case of a natural disaster or any unforeseen circumstance beyond human control including but not limited to rains, storms, land sliding, accident, flat tires, engine failure or other vehicle mal-function etc.,\n• Travel with smile can cancel booking at any time.\n• travel with smile can change terms and conditions at any time.\n• Personal weapons are strictly not allowed.\n• Separate rooms for couples, but will be charged accordingly.\n• No drugs or alcohol will be entertained, members should avoid from all sort of illegal and unethical stuff.\n• Sight tickets for forts are not included in the package.',	NULL,	NULL,	NULL,	NULL,	'Travel with smile',	'Muhammad ismail',	'2147483647',	'm.ismail.kadri123@gmail.com',	'2147483647',	'2022-11-01 01:05:30',	1,	'2022-10-31 20:05:30'),
